import React from "react";
import "../App.css";

const Header = () => {
  return (
    <div className="header">
      <Image
        source={{
          uri:
            "https://raw.githubusercontent.com/AboutReact/sampleresource/master/logosmalltransparen.png"
        }}
        style={{
          width: 40,
          height: 40,
          borderRadius: 40 / 2,
          marginLeft: 15
        }}
      />
      NUS-WING COVID-19
    </div>
  );
};

export default Header;
